-- A basic address database with no duplicate.
-- ---
PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE addresses(
                lat REAL NOT NULL,
                lon REAL NOT NULL,
                number TEXT,
                street TEXT NOT NULL,
                unit TEXT,
                city TEXT,
                district TEXT,
                region TEXT,
                postcode TEXT,
                PRIMARY KEY (lat, lon, number, street, city)
            );
COMMIT;
